import React from 'react';
import { Container } from 'react-bootstrap';
//import './styles.css'
import 'bootstrap/dist/css/bootstrap.min.css';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';

import  youtube from "../images/youtube-logo.svg";
import  instagram from '../images/instagram-logo.svg';
import  twitter from '../images/twitter-logo.svg';
import  facebook from '../images/facebook-logo.svg';


function Rodape() {
  
  return (
    <Container>
    <Navbar  bg="dark" variant="dark" className="justify-content-center" expand="lg"> 
    <Nav  defaultActiveKey="/home" as="ul">
      <Nav.Item  as="li">
        <Nav.Link href={"https://youtube.com"}> Redes Sociais </Nav.Link>
      </Nav.Item>
      <Nav.Item as="li">
        <Nav.Link href={"https://instagram.com"}>Reservas</Nav.Link>
      </Nav.Item>
      <Nav.Item as="li">
        <Nav.Link href={"https://twitter.com"}>WhatsApp</Nav.Link>
      </Nav.Item>
      <Nav.Item as="li">
        <Nav.Link href={"https://facebook.com"}>WhatsApp</Nav.Link>
      </Nav.Item>
    </Nav>
    </Navbar>
    </Container>
         
  );
}

export default Rodape;
